(30960, 88992, 0, 1, ' Our Christmas in Somewhere', '給聖誕中每一個單身、失去親人好友或失意的人，記去不愉快的放在心中，但日子還是要過，活著便會有更美好的。', '2010-12-29 00:00:00', 2000, 0, 2, 7, 'Our Christmas in Somewhere\r\n\r\n倒數十秒　進入這冬天的盛節\r\n滿目的白色　斑斕的燈飾\r\n多少情人的愛相互温暖的\r\n\r\n諷刺的是　總和某人的失意重叠\r\n孤單寂寞的　痛失親人的\r\n內藏讓人更刺痛的\r\n\r\n(ALL　RIGHT)\r\n你不是給遺下一個\r\n快樂也不少你一個\r\n活著便有更美好的\r\n\r\nI wish you a Merry Christmas \r\nI wish you a Merry Christmas\r\n就聽著聖誕歌　把傷心都忘了\r\n解開自己的枷鎖　日子還是要繼續過\r\n閉起眼祝願　聖誕會快樂', '', 84, '', 'tonyi ng', 'tonyi ng', 'tonyi ng', '', '', 0, 0, 1, '2010-12-29 12:58:50', '2013-10-07 17:17:41', '0000-00-00 00:00:00'),
